import React, { Component } from 'react';
import BasePageWithCard from '../pages/BasePageWithCard'
import MarksCompletionForm from '../components/Forms/MarksCompletion/MarksCompletionForm'



export default class FormMarksCompletion extends Component {
  render() {
    const studentData=this.props.studentData
    return (
      <BasePageWithCard isAuthenticated={true} studentData={studentData}>
       <MarksCompletionForm/>
      </BasePageWithCard>
    );
  }
}
